import React, { useEffect, useState } from 'react';
import Axios from 'axios';

const App = () => {
  const [data, setData] = useState('');

  const getdata = async () => {
    const response = await Axios.get('http://localhost:2001/getdata');
    setData(response.data);
  };

  useEffect(() => {
    getdata();
  }, []);

  return (
    <div>
      {data}
    </div>
  );
};

export default App;
